    var firebaseCurrentUser = firebase.auth().currentUser;

    if (to.path === "/pages/login" || to.path === "/pages/forgot-password" || to.path === "/pages/error-404" || to.path === "/pages/error-500" || to.path === "/pages/register" || to.path === "/callback" || to.path === "/pages/comingsoon" || to.path === "/test1" || service.isLoggedIn()) {
