/*=========================================================================================
  File Name: router.js
  Description: Routes for vue-router. Lazy loading is enabled.
  Object Strucutre:
                    path => router path
                    name => router name
                    component(lazy loading) => component to load
                    meta : {
                      rule => which user can have access (ACL)
                      breadcrumb => Add breadcrumb to specific page
                      pageTitle => Display title besides breadcrumb
                    }
  ----------------------------------------------------------------------------------------
  Item Name: Vuesax Admin - VueJS Dashboard Admin Template
  Author: Pixinvent
  Author URL: http://www.themeforest.net/user/pixinvent
==========================================================================================*/


import Vue from 'vue'
import Router from 'vue-router'
import auth from "@/auth/authService";

import firebase from 'firebase/app'
import 'firebase/auth'
import service from '@/service/service'

Vue.use(Router)

const router = new Router({
  mode: 'history',
  base: process.env.BASE_URL,
  scrollBehavior() {
    return { x: 0, y: 0 }
  },
  routes: [
   
    {
      // =============================================================================
      // MAIN LAYOUT ROUTES
      // =============================================================================
      path: '',
      component: () => import('./layouts/main/Main.vue'),
      children: [
        // =============================================================================
        // Theme Routes
        // =============================================================================
        // {
        //   path:'/pages/test1',
        //   components:()=>import('./layouts/components/vx-sidebar/test.vue'),
        //   meta: {
        //     rule: 'editor'
        //   }
        // },
        {
          path: '/',
          redirect: '/dashboard/analytics'
        },
        {
          path: '/dashboard/analytics',
          name: 'dashboardAnalytics',
          component: () => import('./views/DashboardAnalytics.vue'),
          meta: {
            rule: 'editor'
          }
        },
        {
          path: '/dashboard/ecommerce',
          name: 'dashboardECommerce',
          component: () => import('./views/DashboardECommerce.vue'),
          meta: {
            rule: 'admin'
          }
        },
        {
          path: '/general-data/device-group',
          name: 'device-group',
          component: () => import('./views/pages/device-group/DeviceGroup.vue'),
          meta: {
            rule: 'admin'
          }
        },
        {
          path: '/general-data/user-group',
          name: 'device-group',
          component: () => import('./views/pages/user-group/UserGroup.vue'),
          meta: {
            rule: 'admin'
          }
        },
        {
          path: '/general-data/test1',
          name: 'device-group',
          component: () => import('./views/pages/test.vue'),
          meta: {
            rule: 'admin'
          }
        },
        {
          path: '/general-data/device-group-type',
          name: 'device-group-type',
          component: () => import('./views/pages/device-group-type/DeviceGroupType.vue'),
          meta: {
            rule: 'admin'
          }
        },
        {
          path: '/general-data/device',
          name: 'device',
          component: () => import('./views/pages/devices/Device.vue'),
          meta: {
            rule: 'editor'
          }
        },
        {
          path: '/general-data/user',
          name: 'user',
          component: () => import('./views/pages/users/User.vue'),
          meta: {
            rule: 'admin'
          }
        },
        {
          path: '/general-data/device-type',
          name: 'user',
          component: () => import('./views/pages/device-type/DeviceType.vue'),
          meta: {
            rule: 'admin'
          }
        },

        // =============================================================================
        // Application Routes
        // =============================================================================
        {
          path: '/apps/todo',
          name: 'todo',
          component: () => import('./views/apps/todo/Todo.vue'),
          meta: {
            rule: 'editor'
          }
        },
        {
          path: '/apps/chat',
          name: 'chat',
          component: () => import('./views/apps/chat/Chat.vue'),
          meta: {
            rule: 'editor'
          }
        },
        {
          path: '/apps/email',
          name: 'email',
          component: () => import('./views/apps/email/Email.vue'),
          meta: {
            rule: 'editor'
          }
        },
        {
          path: '/apps/calendar/vue-fullcalendar',
          name: 'calendarFullCalendar',
          component: () => import('./views/apps/calendar/FullCalendar.vue'),
          meta: {
            rule: 'editor'
          }
